From the twisted brains of Peter Milligin and Michael Allred comes X-Statix, a funny and thoroughly modern take on superheroes in the age of reality television and mass public consumption of media. This a group that is essentially self-satire of the entire genre. Originally appearing in X-Force 116, this take proved somewhat divisive and after issue 129 they were given their own title. The series is full of the the trademark Allred art style and Milligan's loopy humor. Also...DOOP. More Doop, you can never really have enough Doop in life. I may not have explained myself the best here but check out the wiki, and you'll understand what I mean. And again...DOOP!

This torrent only contains the new X-Statix and Deadgirl digital copies; I have elected X-Force 116-129 because there are only low resolution scans available and they are plenty easy to find (and not necessarily required reading). These new copies are thanks to AnPymGold-Empire, and are much appreciated. I have also added the full Doopspeak text and the image featuring the Doop translator, you can see what he (it?) is saying all of the time. Fun stuff and I hope you enjoy it, please seed! :-)
